Text:
Avsnitten som jag lägger upp från 4 säsongen kommer från http://btefnet.net/ som någon kommenterade i förra tråden. Jag lägger upp dom här på TPB som en service för er, men om ni tycker att det är onödigt att avsnitten ligger på båda ställena så säg till så struntar jag i och lägga upp dom. 

Men så länge jag ser att det finns intresse för mina torrents så tolkar jag det som att det trots allt finns intresse...

///Foppa
